    for (let c of str.toLowerCase()) {
      if (alpha.includes(c)) {
        console.log(c);
        return true;
      }
    }
    return false;
  }

  if (allLetters(props.name)) {
    console.log(props.name);
  }
  return (
    <div>
      <h3 className={classes.name}>{props.name}</h3>
    </div>
  );
};

export default PlaylistItem;
